//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Miras {
    struct inheritor {
        address payable inheritorAddress;
        uint percentage;
    }
    
    mapping(address => inheritor) public inheritors;
    address[] public inheritorAddresses;
    address payable public owner;
    address  public contractAddress;
   
//    mirasçıları ve yüzdelerinin girilmesi 
   constructor(address payable[] memory _inheritorAddresses, uint[] memory _percentages) {
        require(_inheritorAddresses.length == _percentages.length, "Invalid input lengths.");
        contractAddress = address(this);
        owner = payable(msg.sender);

        uint totalPercentage = 0;

        for (uint i = 0; i < _inheritorAddresses.length; i++) {
            require(_percentages[i] > 0 && _percentages[i] <= 100, "Percentage must be between 1 and 100.");
            require(inheritors[_inheritorAddresses[i]].inheritorAddress == address(0), "Beneficiary already exists.");

            inheritors[_inheritorAddresses[i]] = inheritor(payable(_inheritorAddresses[i]), _percentages[i]);
            inheritorAddresses.push(_inheritorAddresses[i]);

            totalPercentage += _percentages[i];
        }

        require(totalPercentage == 100, "Total percentage of inheritors must be 100.");
    }

    function addInheritor(address payable _inheritorAddress, uint _percentage) public {
        require(msg.sender == owner, "Only the contract owner can add inheritors.");
        require(_percentage > 0 && _percentage <= 100, "Percentage must be between 1 and 100.");
        require(inheritors[_inheritorAddress].inheritorAddress == address(0), "inheritor already exists.");

        inheritors[_inheritorAddress] = inheritor(payable(_inheritorAddress), _percentage);
        inheritorAddresses.push(_inheritorAddress);
    }

    // function removeinheritor(address payable _inheritorAddress) public {
    //     require(msg.sender == owner, "Only the contract owner can remove inheritors.");

    //     delete inheritors[_inheritorAddress];

    //     for (uint i = 0; i < inheritorAddresses.length; i++) {
    //         if (inheritorAddresses[i] == _inheritorAddress) {
    //             inheritorAddresses[i] = inheritorAddresses[inheritorAddresses.length - 1];
    //             inheritorAddresses.pop();
    //             break;
    //         }
    //     }
    // }
    
    // para yatırma fonksiyonu
    // require da paranın en az 1 eth olması isteniyor (wei cinsinden)
    function fund() public payable{
        require(msg.value >= 1e18 ,"Did not send enough"  );

    }

    // contract bakiyesini görmek için 
    function getContractBalance() public view returns (uint) {
        return address(this).balance;
    }

    function senEth() public  {
        require(msg.sender == owner, "Only the contract owner can distribute inheritance.");
        require(inheritorAddresses.length > 0, "No inheritors added.");
        require(address(this).balance > 0, "No inheritance amount provided.");

        // uint totalPercentage = 0;
        

        // for (uint i = 0; i < inheritorAddresses.length; i++) {
        //     totalPercentage += inheritors[inheritorAddresses[i]].percentage;
        // }

        // require(totalPercentage == 100, "Total percentage of inheritors must be 100.");

        for (uint i = 0; i < inheritorAddresses.length; i++) {
            uint inheritorAmount = (address(this).balance * inheritors[inheritorAddresses[i]].percentage) / 100;
            // inheritors[inheritorAddresses[i]].inheritorAddress.transfer(inheritorAmount);
            (bool callSuccess, ) = inheritors[inheritorAddresses[i]].inheritorAddress.call{value: inheritorAmount}("");
            require(callSuccess,"Call Failed");
            
        }

        
        
    }
// lazım olursa diye miras sahibinin parayı çekmesi işlemi için    
    function withdraw(uint amount) public {
         (bool callSucces, ) =owner.call{value: amount}("");
         require(callSucces,"Call Failed");
    }


receive() external payable{
  fund();
}

fallback() external payable{
  fund();
}
}

